import "./CustomeCarsoule.css";

import img1 from "../../asstes/images/DC.png";
import img2 from "../../asstes/images/MI.png";
import img3 from "../../asstes/images/PK.png";
import img4 from "../../asstes/images/RCB.png";

const Images = [img1,img2,img3,img4];
let i = 0;
function ImgSlid(){
    document.getElementById("imgSlid").src = Images[i];
    if(i < Images.length-1){
        i++;
    }else{
        i = 0;
    }
    setInterval(ImgSlid,2000)
}




const CustomeCarsoule = () =>{
    return (
        <div className="customc-container"> 
            <h2 className="customc-heading"> 2025 </h2>
            
            <div className="customc-body">
            <div className="customc-leftbox">
                <h1 className="customc-heading"> 1294</h1>
                <p className="customc-para"> Four </p>
                <img src={img1} alt="simple image" id="imgSlid"/>
            </div>
            {/* center */}
            <div className="customc-centerbox">
                <h1 className="customc-heading"> 1294</h1>
                <p className="customc-para"> Four </p>
            </div>
            {/* right */}
            <div className="customc-leftbox">
                <h1 className="customc-heading"> 1294</h1>
                <p className="customc-para"> Four </p>
            </div>
            </div>

        </div>
    );
}
export default CustomeCarsoule;
